                                    116 => 
                                    array (
                                        'id' => 131,
                                        'title' => 'we_are_committed_to_streamlining_your_search_for_care,_making_it_a_seamless_and_empowering_experience._through_our_user-friendly_interface_and_advanced_search_capabilities,_you_can_easily_explore_a_curated_selection_of_care_options_that_meet_your_specific_needs_and_preferences.',
                                        'en' => 'We are committed to streamlining your search for care, making it a seamless and empowering experience. Through our user-friendly interface and advanced search capabilities, you can easily explore a curated selection of care options that meet your specific needs and preferences.',
                                        'es' => 'Estamos comprometidos a agilizar su búsqueda de atención, convirtiéndola en una experiencia perfecta y empoderadora. A través de nuestra interfaz fácil de usar y capacidades de búsqueda avanzada, puede explorar fácilmente una selección curada de opciones de atención que satisfagan sus necesidades y preferencias específicas.',
                                        'created_at' => '2023-08-07 14:58:17',
                                        'updated_at' => '2023-08-07 14:58:17',
                                    ),
                                    117 => 
                                    array (
                                        'id' => 132,
                                        'title' => 'the_importance_of_finding_care_that_aligns_with_your_values,_lifestyle,_and_requirements_cannot_be_understated._we_recognize_that_each_individual_is_unique,_and_so_are_their_care_needs._our_platform_connects_you_with_compassionate_caregivers_and_reputable_care_facilities_that_prioritize_your_well-being_and_comfort.',
                                        'en' => 'The importance of finding care that aligns with your values, lifestyle, and requirements cannot be understated. We recognize that each individual is unique, and so are their care needs. Our platform connects you with compassionate caregivers and reputable care facilities that prioritize your well-being and comfort.',
                                        'es' => 'La importancia de encontrar atención que se alinee con sus valores, estilo de vida y requisitos no puede ser subestimada. Reconocemos que cada individuo es único, y también lo son sus necesidades de atención. Nuestra plataforma lo conecta con cuidadores compasivos y centros de atención de buena reputación que priorizan su bienestar y comodidad.',
                                        'created_at' => '2023-08-07 14:58:17',
                                        'updated_at' => '2023-08-07 14:58:17',
                                    ),
                                    118 => 
                                    array (
                                        'id' => 133,
                                        'title' => 'whether_you_are_exploring_home_care,_assisted_living,_specialized_medical_services,_or_any_other_form_of_care,_we_are_here_to_guide_you_with_compassion_and_integrity._your_well-being_is_at_the_heart_of_everything_we_do.',
                                        'en' => 'Whether you are exploring home care, assisted living, specialized medical services, or any other form of care, we are here to guide you with compassion and integrity. Your well-being is at the heart of everything we do.',
                                        'es' => 'Ya sea que esté explorando la atención domiciliaria, la vida asistida, los servicios médicos especializados o cualquier otra forma de atención, estamos aquí para guiarlo con compasión e integridad. Su bienestar está en el corazón de todo lo que hacemos.',
                                        'created_at' => '2023-08-07 14:58:17',
                                        'updated_at' => '2023-08-07 14:58:17',
                                    ),
