                                        'title' => 'caregivers_are_the_heart_and_soul_of_our_communities,_embodying_compassion,_dedication,_and_selflessness_in_their_daily_endeavors.',
                                        'en' => 'Caregivers are the heart and soul of our communities, embodying compassion, dedication, and selflessness in their daily endeavors.',
                                        'es' => 'Los cuidadores son el corazón y el alma de nuestras comunidades, encarnando la compasión, la dedicación y el desinterés en sus esfuerzos diarios.',
