                                    121 => 
                                    array (
                                        'id' => 136,
                                        'title' => 'we_extend_a_warm_welcome_to_care_providers_like_you,_who_are_dedicated_to_making_a_positive_impact_on_the_lives_of_those_in_need_of_compassionate_support._at_[your_website_name],_we_understand_that_your_work_is_not_just_a_job;_it\'s_a_calling—a_calling_to_bring_comfort,_joy,_and_a_sense_of_security_to_those_you_care_for.',
                                        'en' => 'We extend a warm welcome to care providers like you, who are dedicated to making a positive impact on the lives of those in need of compassionate support. At [Your Website Name], we understand that your work is not just a job; it\'s a calling—a calling to bring comfort, joy, and a sense of security to those you care for.',
                                        'es' => 'Extendemos una cálida bienvenida a los proveedores de atención como usted, que están dedicados a tener un impacto positivo en las vidas de aquellos que necesitan apoyo compasivo. En [Nombre de su sitio web], entendemos que su trabajo no es solo un trabajo; Es un llamado, un llamado a brindar consuelo, alegría y una sensación de seguridad a aquellos que cuidas.',
                                        'created_at' => '2023-08-07 14:58:17',
                                        'updated_at' => '2023-08-07 14:58:17',
                                    ),
                                    122 => 
                                    array (
                                        'id' => 137,
                                        'title' => 'our_platform_is_designed_with_your_needs_in_mind._we_know_that_flexibility,_work-life_balance,_and_fair_compensation_are_essential_elements_in_your_career_journey._that\'s_why_we_are_committed_to_empowering_you_to_find_a_job_tailored_to_your_own_schedule,_hours,_routes,_and_salary.',
                                        'en' => 'Our platform is designed with your needs in mind. We know that flexibility, work-life balance, and fair compensation are essential elements in your career journey. That\'s why we are committed to empowering you to find a job tailored to your own schedule, hours, routes, and salary.',
                                        'es' => 'Nuestra plataforma está diseñada teniendo en cuenta sus necesidades. Sabemos que la flexibilidad, el equilibrio entre la vida laboral y personal y la compensación justa son elementos esenciales en su trayectoria profesional. Es por eso que estamos comprometidos a capacitarlo para encontrar un trabajo adaptado a su propio horario, horario, rutas y salario.',
                                        'created_at' => '2023-08-07 14:58:17',
                                        'updated_at' => '2023-08-07 14:58:17',
                                    ),
                                    123 => 
                                    array (
                                        'id' => 138,
                                        'title' => 'nursing_homes',
                                        'en' => 'Nursing Homes',
                                        'es' => 'Asilos',
                                        'created_at' => '2023-08-07 14:58:17',
                                        'updated_at' => '2023-08-07 14:58:17',
