                                    124 => 
                                    array (
                                        'id' => 139,
                                        'title' => 'nursing_homes_play_a_crucial_role_in_providing_specialized_care_for_our_loved_ones,_and_informed_decision-making_ensures_they_receive_the_exceptional_support_and_attention_they_deserve.',
                                        'en' => 'Nursing homes play a crucial role in providing specialized care for our loved ones, and informed decision-making ensures they receive the exceptional support and attention they deserve.',
                                        'es' => 'Los hogares de ancianos desempeñan un papel crucial en la prestación de atención especializada para nuestros seres queridos, y la toma de decisiones informada garantiza que reciban el apoyo y la atención excepcionales que merecen.',
                                        'created_at' => '2023-08-07 14:58:17',
                                        'updated_at' => '2023-08-07 14:58:17',
                                    ),
                                    125 => 
                                    array (
                                        'id' => 140,
                                        'title' => 'in_addition_to_assisting_families_in_finding_the_best_care_for_their_loved_ones,_we_have_taken_a_step_further_to_support_nursing_homes_in_promoting_their_services_and_bed_availability._we_believe_that_by_connecting_families_with_accurate_and_up-to-date_information_about_nursing_homes,_we_foster_a_transparent_and_supportive_community_for_both_caregivers_and_care_providers.',
                                        'en' => 'In addition to assisting families in finding the best care for their loved ones, we have taken a step further to support nursing homes in promoting their services and bed availability. We believe that by connecting families with accurate and up-to-date information about nursing homes, we foster a transparent and supportive community for both caregivers and care providers.',
                                        'es' => 'Además de ayudar a las familias a encontrar la mejor atención para sus seres queridos, hemos dado un paso más para apoyar a los hogares de ancianos en la promoción de sus servicios y disponibilidad de camas. Creemos que al conectar a las familias con información precisa y actualizada sobre los hogares de ancianos, fomentamos una comunidad transparente y de apoyo tanto para los cuidadores como para los proveedores de atención.',
                                        'created_at' => '2023-08-07 14:58:17',
                                        'updated_at' => '2023-08-07 14:58:17',
                                    ),
                                    126 => 
                                    array (
                                        'id' => 141,
                                        'title' => 'together,_we_strive_to_make_the_process_of_finding_the_right_care_an_empowering_journey,_one_that_emphasizes_collaboration,_compassion,_and_a_commitment_to_enhancing_the_lives_of_those_we_serve._with_our_platform,_nursing_homes_can_confidently_showcase_their_services,_allowing_families_to_make_informed_decisions_that_lead_to_the_highest_quality_of_care_and_peace_of_mind_for_their_loved_ones.',
                                        'en' => 'Together, we strive to make the process of finding the right care an empowering journey, one that emphasizes collaboration, compassion, and a commitment to enhancing the lives of those we serve. With our platform, nursing homes can confidently showcase their services, allowing families to make informed decisions that lead to the highest quality of care and peace of mind for their loved ones.',
                                        'es' => 'Juntos, nos esforzamos por hacer que el proceso de encontrar la atención adecuada sea un viaje de empoderamiento, uno que enfatice la colaboración, la compasión y el compromiso de mejorar las vidas de aquellos a quienes servimos. Con nuestra plataforma, los hogares de ancianos pueden mostrar con confianza sus servicios, lo que permite a las familias tomar decisiones informadas que conducen a la más alta calidad de atención y tranquilidad para sus seres queridos.',
                                        'created_at' => '2023-08-07 14:58:17',
                                        'updated_at' => '2023-08-07 14:58:17',
                                    ),
                                    127 => 
                                    array (
                                        'id' => 142,
                                        'title' => 'we_believe_every_patient_deserves_the_highest_quality_care_possible_especially_at_their_most_vulnerable_state._we_want_to_provide_as_much_information_as_possible_to_help_families_make_the_best_decisions.',
                                        'en' => 'We Believe Every Patient Deserves The Highest Quality Care Possible Especially At Their Most Vulnerable State. We Want To Provide As Much Information As Possible To Help Families Make The Best Decisions.',
                                        'es' => 'Creemos que cada paciente merece la atención de la más alta calidad posible, especialmente en su estado más vulnerable. Queremos proporcionar tanta información como sea posible para ayudar a las familias a tomar las mejores decisiones.',
                                        'created_at' => '2023-08-07 15:59:34',
                                        'updated_at' => '2023-08-07 15:59:34',
                                    ),
                                    128 => 
